import React from 'react';
import '../styles/Wallet.css';

function Wallet({name, message, likes}){
    return(
        <div className='wallet__comp'>
            <h3>{name}</h3>
            <p>{message}</p>
            <h3>{likes}</h3>
        </div>
    );
}

export default Wallet;
